import { Component, Input } from '@angular/core';

@Component({
  selector: 'app-skills',
  templateUrl: './skills.component.html',
  styleUrls: ['./skills.component.scss']
})
export class SkillsComponent {

  @Input() title:string = "Mes compétences"

}

<section class="jumbotron text-center">
  <div class="container">
    <br />
    <h1 class="jumbotron-heading">{{title}}</h1>
  </div>
</section>

<div class="card" style="width: 18rem;">
  <img class="card-img-top" src="https://www.google.com/url?sa=i&url=https%3A%2F%2Ffr.wikipedia.org%2Fwiki%2FPHP&psig=AOvVaw3gcbEeypPjm9rXcXZRUYkw&ust=1676664277731000&source=images&cd=vfe&ved=0CA0QjRxqFwoTCMD__6frmv0CFQAAAAAdAAAAABAD" alt="Card image cap">
  <div class="card-body">
    <h5 class="card-title">Card title</h5>
    <p class="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
    <a href="#" class="btn btn-primary">Go somewhere</a>
  </div>
</div>
